export const leaderboardData = rawLeaderboardData
  .map(user => ({
    ...user,
    total_points: user.total_points === null || user.total_points === undefined 
      ? parseFloat(user.beefy_points) + parseFloat(user.pooltogether_points)
      : parseFloat(user.total_points)
  }))
  .filter(user => user.total_points > 0)
  .sort((a, b) => b.total_points - a.total_points);

export const calculateRank = (userAddress) => {
  const sortedData = [...leaderboardData].sort((a, b) => b.total_points - a.total_points);
  const userIndex = sortedData.findIndex(user => user.address.toLowerCase() === userAddress.toLowerCase());
  return userIndex !== -1 ? userIndex + 1 : null;
};

export const getLeaderboardWithRanks = () => {
  return leaderboardData
    .sort((a, b) => b.total_points - a.total_points)
    .map((user, index) => ({
      ...user,
      rank: index + 1
    }));
};

const calculateProgramStats = () => {
  const totalParticipants = leaderboardData.length;
  const totalPointsDistributed = leaderboardData.reduce((sum, user) => sum + parseFloat(user.total_points), 0);
  
  return {
    totalParticipants,
    totalPointsDistributed,
    activePartners: 3,
    programEndDate: "2025-10-20",
    weeklyUpdate: "Monday"
  };
};

export const programStats = calculateProgramStats();

